import React from 'react';
import Home from './Home.js';
import {Route, Switch,  BrowserRouter, Link} from 'react-router-dom';
import Login from './Login.js';

class App extends React.Component {
    render() {
        return (
            <div className="App">
                <BrowserRouter>
               >

                    <Switch>
                    <Route exact path="/Home">
                        <Home />
                    </Route>
                        <Login />
                    </Switch>
                </BrowserRouter>
            </div>
        );
    }
};

export default App;
